import React from 'react';
//import logo from './logo.svg';
import './App.css';

function CajaTexto(props) {
    return ( <
        div > < input type = "text"
        name = "nombredelacaja"
        placeholder = { props.PlaceHolderUsuario }
        /></div >
    )
}

class FormLogin extends React.Component {
    render() {
        return ( <
            div >
            <
            div className = "App-titulo" > { this.props.TituloPrincipal } < /div> <
            div > < input type = "text"
            name = "nombredelacaja"
            placeholder = { this.props.PlaceHolderUsuario }
            /></div >
            <
            div > < input type = "password"
            name = "txtPassword"
            placeholder = "**********" / > < /div> <
            div > < button type = "button" > Click Me! < /button></div >
            <
            /div>
        )
    }
}

class App extends React.Component {
    render() {
        return ( <
            div className = "App" >
            <
            header className = "App-header" >

            <
            FormLogin TituloPrincipal = "KeyManage"
            PlaceHolderUsuario = "Usuario" > < /FormLogin> <
            FormRegistroDatosPersonales > < /FormRegistroDatosPersonales>

            <
            /header> <
            /div>
        )
    }
}


class FormRegistroDatosPersonales extends React.Component {
    render() {
        return ( <
            div >
            <
            CajaTexto > < /CajaTexto>    <
            CajaTexto > < /CajaTexto> <
            CajaTexto > < /CajaTexto> <
            CajaTexto PlaceHolderUsuario = "Usuario" > < /CajaTexto> <
            CajaTexto > < /CajaTexto> <
            CajaTexto > < /CajaTexto> <
            CajaTexto > < /CajaTexto>         <
            /div>

        )
    }
}

export default App;
